import logo from '../images/licensebadge.png';
import bannerimg from '../images/bannerimg.png';

function HomeCategories() {
    return(
        <>
            <div className="container section-banner">
                <div className="row">
 
                    <div className="col">
                        <p><h1>Deliverying Health, One Prescription  At A Time</h1></p>
                        <p>Driven by our mission to improve lives through reliable pharmaceutical distribution, we pride ourselves on our extensive product portfolio, streamlined logistics, and unwavering dedication to regulatory compliance. Our experienced team ensures that every product reaching you is <highlight>authentic</highlight>, <highlight>safe</highlight>, and <highlight>prompt</highlight>.</p>
                        <p><img className="icon" src={logo} alt="PharmLine logo"/>Licensed distributor in Singapore</p>
                        <a class="btn btn-primary raise" href="#contact-us" role="button">Get in touch with us</a>
                    </div>

                    <div className="col">
                        <img className="bannerimg" src={bannerimg} alt="banner"/>
                    </div>

                </div>
            </div>
        </>
    );
}

export default HomeCategories;
